import React from 'react';
import { Media, Image, Col } from 'react-bootstrap';
import './style.css';
const work = (props) => {
    const {
        title,
        imageUrl,
        projectDescription,
        projectUrl,
    } = props.workDetail;
    console.log(title, imageUrl, projectDescription, projectUrl);
    return (
        <Media xs={6} md={4}>
            <Col>
                <Image
                    className="projectImage"
                    fluid
                    src="https://i.ibb.co/wg01kTt/Spices.jpg"
                    rounded
                />{' '}
            </Col>
            <Col>
                <Media.Body>
                    <h5>Media Heading</h5>
                    <p>
                        Cras sit amet nibh libero, in gravida nulla. Nulla vel
                        metus scelerisque ante sollicitudin commodo. Cras purus
                        odio, vestibulum in vulputate at, tempus viverra turpis.
                        Fusce condimentum nunc ac nisi vulputate fringilla.
                        Donec lacinia congue felis in faucibus.
                    </p>
                </Media.Body>
            </Col>
        </Media>
    );
};

export default work;
